import React from 'react';
import UserTable from './React.user.table';
import UserChart from './React.user.chart';
import 'react-vis/dist/style.css';
import '../css/main.css';

function UserWorkspace(props) {
    return (
        <div>
            <div className="title">
                <h1>{props.userName}</h1>
                <h2>{props.userCompany}</h2>
                <p>{props.userUnit}</p>
            </div>

            <div className="chart">
                <h2>График посещаемости пользователя в период с {props.startDate} по {props.finishDate}</h2>
                <UserChart
                    chartVisits={props.chartVisits}
                    chartViews={props.chartViews}
                />
            </div>

            <div className="data">
                <h2>Журнал посещаемости пользователя в период с {props.startDate} по {props.finishDate}</h2>
                <UserTable rows={props.userLogs} />
            </div>
        </div>
    );
}

export default UserWorkspace;
